const mapEl = document.getElementById('map');
const infoEl = document.getElementById('info');

/* Build islands */
const islandEls = new Map();
islands.forEach(isle => {
    const el = document.createElement('div');
    el.className = 'island';
    el.style.width = 120 * isle.xscale + 'px';
    el.style.height = 90 * isle.yscale + 'px';
    el.style.left = isle.x + 'px';
    el.style.top = isle.y + 'px';
    el.style.backgroundImage = `url('${isle.img}')`;
    el.dataset.id = isle.id;
    mapEl.appendChild(el);
    islandEls.set(isle.id, el);
});

/* Build bridges */
const bridgeEls = new Map();
bridges.forEach(bridge => {
    const a = islands.find(i => i.id === bridge.a);
    const b = islands.find(i => i.id === bridge.b);

    // Updated position calculations
    const aX = a.x + 0.5 * 120 * a.xscale;
    const aY = a.y + 0.5 * 90 * a.yscale;
    const bX = b.x + 0.5 * 120 * b.xscale;
    const bY = b.y + 0.5 * 90 * b.yscale;

    if (bridge.path === 'curve' && bridge.controlPoints) {
        // Create SVG for curved bridge
        const svg = document.createElementNS('http://www.w3.org/2000/svg', 'svg');
        svg.className = 'bridge';

        // Calculate bounding box
        const minX = Math.min(aX, bX, ...bridge.controlPoints.map(p => p.x));
        const maxX = Math.max(aX, bX, ...bridge.controlPoints.map(p => p.x));
        const minY = Math.min(aY, bY, ...bridge.controlPoints.map(p => p.y));
        const maxY = Math.max(aY, bY, ...bridge.controlPoints.map(p => p.y));

        svg.style.position = 'absolute';
        svg.style.left = minX + 'px';
        svg.style.top = minY + 'px';
        svg.style.width = (maxX - minX) + 'px';
        svg.style.height = (maxY - minY) + 'px';
        svg.style.pointerEvents = 'none';

        // Create path
        const path = document.createElementNS('http://www.w3.org/2000/svg', 'path');
        let pathData = `M ${aX - minX} ${aY - minY}`;

        if (bridge.controlPoints.length === 1) {
            // Quadratic curve
            const cp = bridge.controlPoints[0];
            pathData += ` Q ${cp.x - minX} ${cp.y - minY} ${bX - minX} ${bY - minY}`;
        } else if (bridge.controlPoints.length === 2) {
            // Cubic curve
            const cp1 = bridge.controlPoints[0];
            const cp2 = bridge.controlPoints[1];
            pathData += ` C ${cp1.x - minX} ${cp1.y - minY} ${cp2.x - minX} ${cp2.y - minY} ${bX - minX} ${bY - minY}`;
        }

        path.setAttribute('d', pathData);
        path.setAttribute('stroke', '#333');
        path.setAttribute('stroke-width', '3');
        path.setAttribute('stroke-dasharray', '5,5');
        path.setAttribute('fill', 'none');

        svg.appendChild(path);
        mapEl.appendChild(svg);
        bridgeEls.set(bridge.id, svg);
    } else {
        // Create straight line bridge (original logic)
        const el = document.createElement('div');
        el.className = 'bridge';

        const dx = bX - aX, dy = bY - aY;
        const length = Math.hypot(dx, dy);
        const angle = Math.atan2(dy, dx) * 180 / Math.PI;

        el.style.width = length + 'px';
        el.style.height = '20px';
        el.style.left = aX + 'px';
        el.style.top = aY + 'px';
        el.style.transformOrigin = '0 0';
        el.style.transform = `rotate(${angle}deg) translate(0,-50%)`;
        el.style.borderTop = '3px dotted #333';
        el.style.backgroundColor = 'transparent';

        mapEl.appendChild(el);
        bridgeEls.set(bridge.id, el);
    }
});

/* Token */
const tokenEl = document.createElement('div');
tokenEl.id = 'token';
mapEl.appendChild(tokenEl);
function positionToken(islandId) {
    const isle = islands.find(i => i.id === islandId);
    tokenEl.style.left = isle.x + (0.5 * 120 * isle.xscale) + 'px';
    tokenEl.style.top = isle.y + (0.5 * 90 * isle.yscale) + 'px';
}
positionToken(startIslandId);

function neighbours(islandId) {
    return bridges
        .filter(b => remainingBridges.has(b.id) && (b.a === islandId || b.b === islandId))
        .map(b => b.a === islandId ? b.b : b.a);
}

function updateUI() {
    // manage clickable islands
    islandEls.forEach((el, id) => {
        el.classList.remove('clickable');
        el.onclick = null;
    });
    if (playerTurn) {
        neighbours(currentIslandId).forEach(id => {
            const el = islandEls.get(id);
            el.classList.add('clickable');
            el.onclick = () => playerMove(id);
        });
    }
    
    setTimeout(() => {
        infoEl.textContent = playerTurn ? 'Choose a neighbouring island to which to travel.' : 'It\'s now the computer\'s turn to move.';
    }, 500);
}

function removeBridgeBetween(a, b) {
    const br = bridges.find(br => remainingBridges.has(br.id) && ((br.a === a && br.b === b) || (br.a === b && br.b === a)));
    if (!br) return;

    remainingBridges.delete(br.id);

    const bridgeEl = bridgeEls.get(br.id);
    if (bridgeEl) {
        // Ensure transition is set (in case CSS didn't apply to SVG)
        if (!bridgeEl.style.transition) {
            bridgeEl.style.transition = 'opacity 0.3s';
        }

        // Use requestAnimationFrame to ensure transition is ready
        requestAnimationFrame(() => {
            bridgeEl.classList.add('destroyed');

            // Optional: Remove the element completely after transition
            setTimeout(() => {
                if (bridgeEl.parentNode) {
                    bridgeEl.parentNode.removeChild(bridgeEl);
                }
            }, 300); // Match the CSS transition duration
        });
    }
}

function animateToken(toIslandId, callback) {
    // after CSS transition ends, call callback
    tokenEl.addEventListener('transitionend', function handler() {
        tokenEl.removeEventListener('transitionend', handler);
        callback && callback();
    });
    positionToken(toIslandId);
}

function endGame(winner) {
    infoEl.textContent = winner;
    // disable further input
    islandEls.forEach(el => { el.onclick = null; el.classList.remove('clickable'); });
}

function checkLose(islandId) {
    return neighbours(islandId).length === 0;
}

function playerMove(targetId) {
    if (!playerTurn || !neighbours(currentIslandId).includes(targetId)) return;
    playerTurn = false;
    removeBridgeBetween(currentIslandId, targetId);
    animateToken(targetId, () => {
        currentIslandId = targetId;
        if (checkLose(currentIslandId)) {
            endGame('The computer cannot move, so you win. Congratulations!');
        } else {
            setTimeout(computerTurn, 1000);
        }
    });
    updateUI();
}

function computerTurn() {
    const nbs = neighbours(currentIslandId);
    if (nbs.length === 0) {
        endGame('You cannot move, so you lose! Reload the page to play again.');
        return;
    }
    // call external strategy
    const chosen = computerStrategy({
        currentIsland: currentIslandId,
        neighbours: nbs.slice(),
        remainingBridges: [...remainingBridges]
    });
    const targetId = nbs.includes(chosen) ? chosen : nbs[Math.floor(Math.random() * nbs.length)];
    removeBridgeBetween(currentIslandId, targetId);
    animateToken(targetId, () => {
        currentIslandId = targetId;
        if (checkLose(currentIslandId)) {
            endGame('You cannot move, so you lose! Reload the page to play again.');
        } else {
            playerTurn = true;
            updateUI();
        }
    });
}

