(function () {
  const LOGICAL_W = 900;   // the map’s native width
  const LOGICAL_H = 700;   // the map’s native height

  function rescaleMap () {
    const wrapper = document.querySelector('.bridges-game');
    const map     = document.getElementById('map');

    const avail   = wrapper.clientWidth;           // real space
    const scale   = Math.min(1, avail / LOGICAL_W); // never upscale

    map.style.transform = `scale(${scale})`;
    // give the wrapper the right height so the rest of the page flows
    wrapper.style.height = `${LOGICAL_H * scale}px`;
  }

  window.addEventListener('load',    rescaleMap);
  window.addEventListener('resize',  rescaleMap);
})();
